import React from "react";

export default function Siedbar() {
  return (
    <>
      <div className="sliedbar">
        <div className="slied-icon">
          <button> 
          <i class="fa-solid fa-house fa-2xl"></i>
          </button>
        </div>
      </div>
    </>
  );
}
